import styled from "styled-components";

export const Container = styled.a`
    display: flex;
    align-items: center;
    justify-content: center;

    height: 30px;
    width: 30px;

    padding: 5px;

    box-shadow: 5px 5px 5px ${({theme}) => theme.fontColor};

    border-radius: 100%;
`;

export const Image = styled.img`
    width: 30px;
    height: 30px;

    border-radius: 100%;
`;
